import styled from "styled-components";

const Card = styled("div")`
width:150px;
height:150px;
position:relative;
box-shadow: 1px 1px 10px rgba(0, 0, 0, 0.161);
margin-bottom:60px;
margin-top:20px;
cursor: pointer;
`;
const FileSelector = styled("input")`
opacity: 0;
position: absolute;
z-index: -1;

`;



const CenteredElement = styled("div")`

`;



const Document = () => {
    return (
        <>

            <Card >
                <CenteredElement>
                    <label htmlFor="upload-photo">+ Upload</label>
                    <FileSelector type="file" name="photo" id="upload-photo" />

                </CenteredElement>
            </Card>


        </>
    );
}



export default Document;
